import {useEffect, useState, useRef} from 'react';

function List() {
    
    const [list, setList] = useState([]);

    useEffect(()=>{
        fetch("http://127.0.0.1:8081/gettasks")
        .then(response => response.json())
        .then(setList);
    }, []);


    return (
        <div>
           {list.map(todo => 
            <div style={{border: '1px solid black'}} key={todo.id}><input type={'checkbox'}/>{todo.description}</div>)}
         </div>
       );
    
}

export default List;
